Surgeries are held each weekday morning and afternoon; however, alterations may occur at times because of holiday arrangements, sickness or  training sessions.  


Well Baby Clinic: Wednesday 10:30-12:00 for assessments, immunisations, advice and weight checks;      


Antenatal Clinic: Alternate Tuesday mornings by appointment only;     


Health Weight Clinic: Appointments are held throughout the week, please speak to the reception staff to book an appointment.


