            Additional information
            You should call NHS 111 if:	

•	you need medical help fast, but it’s not a 999 emergency;
•	you don’t know who to call for medical help or you don't have a GP to call;
•	you think you need to go to A&E or another NHS urgent care service; or
•	you require health information or reassurance about what to do next


            Additional information
            How to Register 
All patients are registered with the Practice but can express a preference for a particular doctor.  To register with us you will be asked to complete a registration form and a short questionnaire.  Proof of identity is also required.  We accept anyone who lives within our catchment area and are eligible for treatment.  

&nbsp;
We encourage all new patients to attend a screening appointment to help us establish your health care needs.
 
 
 
 
 
 
 
 

 
 
 

 

